import React from "react";
import Navbar from "./Navbar/Navbar";
import Terminal from "./Terminal/Terminal";
import InfoPanel from "./Panel/Panel";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

const App = () => {
  return (
    <div className="app">
      {/* Navbar */}
      <Navbar />

      {/* Main Content */}
      <div className="row g-0 main-content">
        {/* Left: Terminal */}
        <div className="col-md-6 terminal-section">
          <Terminal />
        </div>

        {/* Right: Info Panel */}
        <div className="col-md-6 info-section">
          <InfoPanel />
        </div>
      </div>
    </div>
  );
};

export default App;
